nally had a wooden stockade with 24 bastions and 44 houses within.","A large fortified village overlooking the east bank of the Missouri River. Village originally had a wooden stockade with 24 bastions and 44 houses within.","A large fortified village overlooking the east bank of the Missouri River. Village originally had a wooden stockade with 24 bastions and 44 houses within.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Upland vegetation: northern mixed grass prairie. Artemisia ludoviciana common locally. Wide littoral zone of Typha angustifolia around lake. A few trees of Salix amygladoides, Populus occidentalis, and Elaeagnus angustifolia. ","Stock dam. Upland vegetation: northern mixed grass prairie, scattered wheat fields.","Reservoir in the Black Hills. Upland vegetation: Pinus ponderosa forest.","Small reservoir. Upland vegetation: Pinus ponderosa forest.","Small recreational reservoir.","Reservoir on Little Moreau Creek located in a wooded ravine. Upland vegetation northern mixed grass prairie with Artemisia cana and A. frigida. Trees and shrubs in ravine: Quercus macrocarpa, Fraxinus pennsylvanica, Acer negundo, Ulmus americana, Salix amygladoides, Populus occidentalis, Shepherdia argentea, Symphoricarpos occidentalis, Crataegus sp. Pinus ponderosa, Picea glauca, and Juniperus scopulorum planted above lake ~300 m distant. Littoral zone of Typha latifolia with Salix exigua along lake shore.","Unamed stock dam. Upland vegetation: northern mixed grass prairie: Bouteloua gracilis, Schizachyrium scoparium, Nassella viridula, Artemisia frigida, A. cana, Opuntia fragilis. No trees near dam. ","Glacial kettle lake. From 1995 to 2011, the lake rose ~8 m and expanded from ~1480 ha to &gt;7700 ha in area. Formerly saline, the lake is now a productive fishery. ","Glacial kettle lake. From 1995 to 2011, the lake rose ~8 m and expanded from ~1480 ha to &gt;7700 ha in area. Formerly saline, the lake is now a productive fishery. ","Glacial kettle lake. From 1995 to 2011, the lake rose ~8 m and expanded from ~1480 ha to &gt;7700 ha in area. Formerly saline, the lake is now a productive fishery. ","Glacial kettle lake. From 1995 to 2011, the lake rose ~8 m and expanded from ~1480 ha to &gt;7700 ha in area. Formerly saline, the lake is now a productive fishery. ","Reservoir. Vegetation: nortern mixed grass prarie. No trees immediately around lake except for Salix exigua. ","Stock dam. Northern mixed grass prairie dominated by Pascopyrum smithii. Artemisia cana and A. frigida common. Nearby shelterbelt with Ulmus pumila and Pinus ponderosa, scattered Elaeagnus angustifolia. Littoral zone of Schoenoplectus 2-3 m wide. ","Upland vegetation: northern mixed grass prairie. Natural and planted trees scattered along shoreline: Fraxinus pennsylvanica, Salix amygladoides, S. exigua, Populus occidentalis, Ulmus pumila, Elaeagnus angustifolia, Acer negundo. Littoral zone of nearly continuous Schoenoplectus, sporadic Typha angustifolia, Spartina pectinata. Aquatic vegetation: abundant Potamogeton. ","Located on the northern margin of the Nebraska Sand Hills. Lake is a deflation basin with a large dune immediately to the south. Upland vegetation: grassland pasture and row crops. Trees line the lake shore: Populus occidentalis (most abundant), Salix amgladoides, Ulmus americana, Acer saccharinum. Small plantation of Pinus ponderosa immediately west of the lake. Littoral zone of intermittant Schoenoplectus. Aquatic macrophytes: Potamogeton, Persicaria amphibia.","A small sinkhole lake with a large spring conduit at least 20 m deep. Except for the conduit, most of the lake is &lt;1 m deep. Lies in Red Valley inside the outer hogback ridge encircling the Black Hills. Vegtation in Red Valley is mixed grass prairie. Black Hills are covered with Pinus ponderosa forest, and scattered P. ponderosa occur on the outer hogback. ","Deflation lake in the northern part of the Nebraska Sand Hills. Upland vegetation: sand hills prairie, row crops, some center pivot irrigation.","Tectonic origin basin on the ourter slope of the Bear Butte uplift. Upland vegetation: mixed grass prairie. Scattered Pinus ponderosa on Bear Butte.","Large, shallow glacial kettle lake on the Prairie Coteau. Landscape heavily agricultural: corn and soybeans, some pasture.","Large, shallow glacial kettle lake on the Prairie Coteau. Landscape heavily agricultural: corn and soybeans, some pasture.","Large, shallow glacial kettle lake on the Prairie Coteau. Landscape heavily agricultural: corn and soybeans, some pasture.","Large, shallow glacial kettle lake on the Prairie Coteau. Landscape heavily agricultural: corn and soybeans, some pasture.","Large, shallow glacial kettle lake on the Prairie Coteau. Landscape heavily agricultural: corn and soybeans, some pasture.","Reservoir. Vegetation northern mixed grass prairie, some wheat fields. Scattered Populus occidentalis, Salix amygdaloides, and Elaeagnus angustifolia near lake.",null,null,null,"Large glacial kettle lake on the Prairie Coteau.","Large glacial kettle lake on the Prairie Coteau.","Large glacial kettle lake on the Prairie Coteau.","Large glacial kettle lake on the Prairie Coteau.","Large glacial kettle lake on the Prairie Coteau.","The western of two adjacent very small ponds in a rock fissure on the summit of Harney Peak. A small stand of Picea glauca occupies the fissure. A few Pinus ponderosa also occur. P. ponderosa dominates the regional vegetation. Pinus flexilis occurs on Harney Peak, but is rare.","Small stock dam in the Conata Basin in the Badlands. Natural vegetation is mixed grass prairie, but the site is surrounded by a very large prairie dog town, which has severely impacted the vegetation.","Small recreational reservoir. Upland vegetation: Pinus ponderosa forest. Quercus macrocarpa and Betula papyrifera occur locally in riparian areas.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Kettle lake on the Prairie Coteau. Lake has expaned in area since the 1990s, merging with several other adjacent basins.","Kettle lake on the Prairie Coteau.","Kettle lake on the Prairie Coteau.","Kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Small stock dam. Upland vegetation: Northern mixed grass prairie, heavily grazed, with abundant Artemisia cana and Opuntia fragilis. Grasses: Pascopyrum smithii, Bouteloua gracilis, Nassella viridula, and Schizachyrium scoparium. Dense stand of Eleocharis erythropoda along shoreline. No trees.","Site is located along a small tributary of the North Fork of Castle Creek draining from Reynolds Prairie. The site has been mined for bog iron, which has exposed outcrops of iron cemented conglomerate. The stream is iron stained.","Site is located along a small tributary of the North Fork of Castle Creek draining from Reynolds Prairie. The site has been mined for bog iron, which has exposed sections of interbedded indurated ferricrete, uninduarated 'bog iron', and peat. The stream is iron stained.","Narrow gulch with small first order stream draining mined iron bogs. Beaver dams are ponding water, and Sphagnum is reclaiming some mined areas. Stream water and beaver dam sediments are iron stained, and iron oxide is precipitating in beaver dams and along the stream. Upland vegetation: Pinus ponderosa forest with Picea glauca on north facing slopes. Picea glauca also grows along the bottom of the draw, and in places Betula glandulosa forms thick stands in draw bottom.","Narrow gulch with small first order stream draining mined iron bogs. Beaver dams are ponding water, and Sphagnum is reclaiming some mined areas. Stream water and beaver dam sediments are iron stained, and iron oxide is precipitating in beaver dams and along the stream. Upland vegetation: Pinus ponderosa forest with Picea glauca on north facing slopes. Picea glauca also grows along the bottom of the draw, and in places Betula glandulosa forms thick stands in draw bottom.","Reservoir surrounded by Pinus ponderosa forest.","Reservoir surrounded by Pinus ponderosa forest.","Reservoir surrounded by Pinus ponderosa forest.","Upland vegetation: northern mixed grass prairie, wheat fields. A few Populus occidentalis and Salix amygladoides along lakeshore. A ring of Spartina pectinata several metres wide surrounds the lake.","This gravel pit was a commercial excavation for sand and gravel, likely excavated in the 1950's. The deposit consists of alluvium which lies atop the Missouri River's eastern side near the mouth of the White River, which apparently places the locality in Brule County.","The site is a 12m high, east-facing cut bank section on the Whetstone River.","The site is a 12m high, east-facing cut bank section on the Whetstone River.","Shallow kettle lake or pothole. Shown as intermittent on the USGS topographic map. Water level has ills Site 1","Iron Hills Site 2","Maitland Draw","Stockade Lake","Peach Lake","Bergner Gravel Pit Locality [SDSM V8420]","Loraff Farm Site","Roslyn Lake","Waubay Lake","Salt Lake","Newell Lake","Waggoner","Carthage","Hayes Lake","Jones Lake","Lost Lake","Rose Hill","Wall Lake","Dudley","Delmont Local Fauna [Hieb Sand Pit]","Blaine site [39CU1144]","Cowboy Pond","Shell Shock Pond","Smith Dam","South Lake Flat Dam","Birdsall Sand &amp; Gravel Pit [Oral Local Fauna]","Medicine Creek Site [39LM222]","Midland Gravel Pits [Midland Local Fauna]","Roosevelt Lake Sands [Roosevelt Lake Local Fauna]","Salamander Cave","NLA06608-0755","NLA06608-0179","Lake Oahe","Lake Wanalain","Loyalton Dam","Richmond","Brant Lake","Brush Lake","Enemy Swim Lake","Eureka Lake","Grass Lake","Heggs","Lake Albert","Lake Alice","Lake Byron","Lake Cochrane","Lake Eli","Lake Isabella","Lake Kampeska","Long Lake2","Lynn Lake","Mutske","Nutleg East","Rath Lake","Rehfeldt Slough","Rush Lake","Turtlefoot Lake","NLA06608-0302","NLA06608-0407","NLA06608-0439","NLA06608-0663","NLA06608-1107","NLA06608-1575","NLA06608-1719","Piyas","Roslyn Pond","GREAT30","NDSU 4","SDSU 5","SDSU 6","SDSU 7","SDSU 8","SDSU 20","SDSU 21"],[null,"Lake in preglacial stream valley. Physiography: Missouri Coteau, gently rolling. Surrounding vegetation: wheatgrass prairie, small-grain fields.","Black Hills. Pinus ponderosa with scattered Picea glauca.","South Dakota Plains. Grassland with Artemisia frigida and A. ludoviciana.","South Dakota Plains. Grassland.","South Dakota Plains. Grassland with Artemisia frigida.","South Dakota Plains. Grassland with Artemisia frigida and A. ludoviciana.","South Dakota Plains. Grassland with Artemisia frigida, some wheat fields; chenopods around water tank.","South Dakota Plains. Grassland with some cultivation.","South Dakota Plains. Grassland with Artemisia ludoviciana.","South Dakota Plains. Cultivated fields.","South Dakota Plains. Cultivated fields and grazed pastures.","South Dakota Plains. Cultivated fields.","Lake in glacial outwash channel. Physiography: Prairie Coteau. Surrounding vegetation: pasture, hayed areas, Populus.","Lake surrounded by steep slopes. Physiography: Coteau des Prairies. Surrounding vegetation: Agricultural, Que/Fra/Til on slopes.","Cattle watering tanks.","Interdunal depression. Physiography: Nebraska Sandhills. Surrounding vegetation: grassland.","Cattle tank, grazed prairie. Surrounding vegetation: heavily trampled prairie, chenopods.","Cattle tank, grazed prairie. Surrounding vegetation: heavily trampled prairie, chenopods.",null,null,null,null,"A large fortified village overlooking the east bank of the Missouri River. Village originally had a wooden stockade with 24 bastions and 44 houses within.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Upland vegetation: northern mixed grass prairie. Artemisia ludoviciana common locally. Wide littoral zone of Typha angustifolia around lake. A few trees of Salix amygladoides, Populus occidentalis, and Elaeagnus angustifolia. ","Stock dam. Upland vegetation: northern mixed grass prairie, scattered wheat fields.","Reservoir in the Black Hills. Upland vegetation: Pinus ponderosa forest.","Small reservoir. Upland vegetation: Pinus ponderosa forest.","Small recreational reservoir.","Reservoir on Little Moreau Creek located in a wooded ravine. Upland vegetation northern mixed grass prairie with Artemisia cana and A. frigida. Trees and shrubs in ravine: Quercus macrocarpa, Fraxinus pennsylvanica, Acer negundo, Ulmus americana, Salix amygladoides, Populus occidentalis, Shepherdia argentea, Symphoricarpos occidentalis, Crataegus sp. Pinus ponderosa, Picea glauca, and Juniperus scopulorum planted above lake ~300 m distant. Littoral zone of Typha latifolia with Salix exigua along lake shore.","Unamed stock dam. Upland vegetation: northern mixed grass prairie: Bouteloua gracilis, Schizachyrium scoparium, Nassella viridula, Artemisia frigida, A. cana, Opuntia fragilis. No trees near dam. ","Glacial kettle lake. From 1995 to 2011, the lake rose ~8 m and expanded from ~1480 ha to &gt;7700 ha in area. Formerly saline, the lake is now a productive fishery. ","Reservoir. Vegetation: nortern mixed grass prarie. No trees immediately around lake except for Salix exigua. ","Stock dam. Northern mixed grass prairie dominated by Pascopyrum smithii. Artemisia cana and A. frigida common. Nearby shelterbelt with Ulmus pumila and Pinus ponderosa, scattered Elaeagnus angustifolia. Littoral zone of Schoenoplectus 2-3 m wide. ","Upland vegetation: northern mixed grass prairie. Natural and planted trees scattered along shoreline: Fraxinus pennsylvanica, Salix amygladoides, S. exigua, Populus occidentalis, Ulmus pumila, Elaeagnus angustifolia, Acer negundo. Littoral zone of nearly continuous Schoenoplectus, sporadic Typha angustifolia, Spartina pectinata. Aquatic vegetation: abundant Potamogeton. ","Located on the northern margin of the Nebraska Sand Hills. Lake is a deflation basin with a large dune immediately to the south. Upland vegetation: grassland pasture and row crops. Trees line the lake shore: Populus occidentalis (most abundant), Salix amgladoides, Ulmus americana, Acer saccharinum. Small plantation of Pinus ponderosa immediately west of the lake. Littoral zone of intermittant Schoenoplectus. Aquatic macrophytes: Potamogeton, Persicaria amphibia.","A small sinkhole lake with a large spring conduit at least 20 m deep. Except for the conduit, most of the lake is &lt;1 m deep. Lies in Red Valley inside the outer hogback ridge encircling the Black Hills. Vegtation in Red Valley is mixed grass prairie. Black Hills are covered with Pinus ponderosa forest, and scattered P. ponderosa occur on the outer hogback. ","Deflation lake in the northern part of the Nebraska Sand Hills. Upland vegetation: sand hills prairie, row crops, some center pivot irrigation.","Tectonic origin basin on the ourter slope of the Bear Butte uplift. Upland vegetation: mixed grass prairie. Scattered Pinus ponderosa on Bear Butte.","Large, shallow glacial kettle lake on the Prairie Coteau. Landscape heavily agricultural: corn and soybeans, some pasture.","Reservoir. Vegetation northern mixed grass prairie, some wheat fields. Scattered Populus occidentalis, Salix amygdaloides, and Elaeagnus angustifolia near lake.",null,"Large glacial kettle lake on the Prairie Coteau.","The western of two adjacent very small ponds in a rock fissure on the summit of Harney Peak. A small stand of Picea glauca occupies the fissure. A few Pinus ponderosa also occur. P. ponderosa dominates the regional vegetation. Pinus flexilis occurs on Harney Peak, but is rare.","Small stock dam in the Conata Basin in the Badlands. Natural vegetation is mixed grass prairie, but the site is surrounded by a very large prairie dog town, which has severely impacted the vegetation.","Small recreational reservoir. Upland vegetation: Pinus ponderosa forest. Quercus macrocarpa and Betula papyrifera occur locally in riparian areas.","Glacial kettle lake on the Prairie Coteau.","Kettle lake on the Prairie Coteau. Lake has expaned in area since the 1990s, merging with several other adjacent basins.","Kettle lake on the Prairie Coteau.","Glacial kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Large kettle lake on the Prairie Coteau.","Small stock dam. Upland vegetation: Northern mixed grass prairie, heavily grazed, with abundant Artemisia cana and Opuntia fragilis. Grasses: Pascopyrum smithii, Bouteloua gracilis, Nassella viridula, and Schizachyrium scoparium. Dense stand of Eleocharis erythropoda along shoreline. No trees.","Site is located along a small tributary of the North Fork of Castle Creek draining from Reynolds Prairie. The site has been mined for bog iron, which has exposed outcrops of iron cemented conglomerate. The stream is iron stained.","Site is located along a small tributary of the North Fork of Castle Creek draining from Reynolds Prairie. The site has been mined for bog iron, which has exposed sections of interbedded indurated ferricrete, uninduarated 'bog iron', and peat. The stream is iron stained.","Narrow gulch with small first order stream draining mined iron bogs. Beaver dams are ponding water, and Sphagnum is reclaiming some mined areas. Stream water and beaver dam sediments are iron stained, and iron oxide is precipitating in beaver dams and along the stream. Upland vegetation: Pinus ponderosa forest with Picea glauca on north facing slopes. Picea glauca also grows along the bottom of the draw, and in places Betula glandulosa forms thick stands in draw bottom.","Reservoir surrounded by Pinus ponderosa forest.","Upland vegetation: northern mixed grass prairie, wheat fields. A few Populus occidentalis and Salix amygladoides along lakeshore. A ring of Spartina pectinata several metres wide surrounds the lake.","This gravel pit was a commercial excavation for sand and gravel, likely excavated in the 1950's. The deposit consists of alluvium which lies atop the Missouri River's eastern side near the mouth of the White River, which apparently places the locality in Brule County.","The site is a 12m high, east-facing cut bank section on the Whetstone River.","Shallow kettle lake or pothole. Shown as intermittent on the USGS topographic map. Water level has risen since 2000 and is now joined with slough to the south.","Large kettle lake on the Prairie Coteau.","Shallow, alkaline lake on the western edge of the Minnesota River lowland.",null,null,null,null,null,null,null,null,null,null,"Site is located on an intermittant stream terrace in Red Valley at the southwestern edge of the Black Hills. Elevation is 1414-1420 m. Vegetation is grassland with open Pinus ponderosa forest on nearby scarps and hills.","Stock pond located in mixed grass prairie.","Stock pond located in mixed grass prairie.","Stock pond located in mixed grass prairie.","Stock pond located in mixed grass prairie.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null],["{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-99,45]}","{\"type\":\"Polygon\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[[[-99.92606,44.82568],[-99.89006,44.82568],[-99.89006,44.84519],[-99.92606,44.84519],[-99.92606,44.82568]]]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-103.71667,44.33333]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-103.41667,44.41667]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-102.85,44.51667]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-102.45,44.58333]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-102.06667,44.66667]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-102,45.03333]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-101.2,45]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-100.35,45.06667]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4326\"}},\"coordinates\":[-99.33333,45.03333]}","{\"type\":\"Point\",\"crs\":{\"type\":\"name\",\"properties\":{\"name\":\"EPSG:4 y trampled prairie, chenopods.","Cattle tank, grazed prairie. Surrounding vegetation: heavily trampled prairie, chenopods.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Reservoir on Little Moreau Creek located in a wooded ravine. Upland vegetation northern mixed grass prairie with Artemisia cana and A. frigida. Trees and shrubs in ravine: Quercus macrocarpa, Fraxinus pennsylvanica, Acer negundo, Ulmus americana, Salix amygladoides, Populus occidentalis, Shepherdia argentea, Symphoricarpos occidentalis, Crataegus sp. Pinus ponderosa, Picea glauca, and Juniperus scopulorum planted above lake ~300 m distant. Littoral zone of Typha latifolia with Salix exigua along lake shore.","Unamed stock dam. Upland vegetation: northern mixed grass prairie: Bouteloua gracilis, Schizachyrium scoparium, Nassella viridula, Artemisia frigida, A. cana, Opuntia fragilis. No trees near dam. ","Glacial kettle lake. From 1995 to 2011, the lake rose ~8 m and expanded from ~1480 ha to &gt;7700 ha in area. Formerly saline, the lake is now a productive fishery. ","Located on the northern margin of the Nebraska Sand Hills. Lake is a deflation basin with a large dune immediately to the south. Upland vegetation: grassland pasture and row crops. Trees line the lake shore: Populus occidentalis (most abundant), Salix amgladoides, Ulmus americana, Acer saccharinum. Small plantation of Pinus ponderosa immediately west of the lake. Littoral zone of intermittant Schoenoplectus. Aquatic macrophytes: Potamogeton, Persicaria amphibia.","Deflation lake in the northern part of the Nebraska Sand Hills. Upland vegetation: sand hills prairie, row crops, some center pivot irrigation.","Upland vegetation: northern mixed grass prairie, wheat fields. A few Populus occidentalis and Salix amygladoides along lakeshore. A ring of Spartina pectinata several metres wide surrounds the lake.","Large kettle lake on the Prairie Coteau.",null,null,
